import React, { useState } from "react";

//stateless
// function Toggle() {
//   return <div className="toggle"></div>;
// }

//statefull

function Toggle() {
  const [on, setOn] = useState(false);
  return (
    <div className="toggle" onClick={() => setOn(true)}>
      Toggle {on ? "On" : "Off"}
    </div>
  );
}

export default Toggle;
